mapper.select:
	SELECT (SELECT COUNT(1) FROM neonatus_info
	where 1 = 1
	
		and province_code = #{provinceCode,jdbcType=VARCHAR}
	
	
		and city_code = #{cityCode,jdbcType=VARCHAR}
	
	
		and county_code = #{countyCode,jdbcType=VARCHAR}
	
	
		and towns_code = #{townsCode,jdbcType=VARCHAR}
	
	
		and village_code = #{villageCode,jdbcType=VARCHAR}
	
	) AS neonatusNum,
	(SELECT COUNT(1) FROM neonatus_info n JOIN
	children_health_record h ON n.archive_no = h.archive_no
	where 1 = 1
	
		and province_code = #{provinceCode,jdbcType=VARCHAR}
	
	
		and city_code = #{cityCode,jdbcType=VARCHAR}
	
	
		and county_code = #{countyCode,jdbcType=VARCHAR}
	
	
		and towns_code = #{townsCode,jdbcType=VARCHAR}
	
	
		and village_code = #{villageCode,jdbcType=VARCHAR}
	
	
            and DATE_FORMAT(h.visit_date, '%Y-%m-%d') >= DATE_FORMAT(#{startTime}, '%Y-%m-%d')
	
	
            and DATE_FORMAT(h.visit_date, '%Y-%m-%d') <= DATE_FORMAT(#{endTime}, '%Y-%m-%d')
	
	) AS childrenHealthNum,
	(SELECT COUNT(1) FROM neonatus_info n JOIN
	children_tcm_record t ON n.archive_no = t.archive_no
	where 1 = 1
	
		and province_code = #{provinceCode,jdbcType=VARCHAR}
	
	
		and city_code = #{cityCode,jdbcType=VARCHAR}
	
	
		and county_code = #{countyCode,jdbcType=VARCHAR}
	
	
		and towns_code = #{townsCode,jdbcType=VARCHAR}
	
	
		and village_code = #{villageCode,jdbcType=VARCHAR}
	
	
            and DATE_FORMAT(t.visit_date, '%Y-%m-%d') >= DATE_FORMAT(#{startTime}, '%Y-%m-%d')
	
	
            and DATE_FORMAT(t.visit_date, '%Y-%m-%d') <= DATE_FORMAT(#{endTime}, '%Y-%m-%d')
	
	) AS childrenTcmNum

    select 
    
    from neonatus_info
    where 1 = 1
     
       and  province_code = #{provinceCode,jdbcType=VARCHAR}
        
     
       and  city_code = #{cityCode,jdbcType=VARCHAR}
      
     
       and  county_code = #{countyCode,jdbcType=VARCHAR}
       
     
       and  towns_code = #{townsCode,jdbcType=VARCHAR}
       
     
       and  village_code = #{villageCode,jdbcType=VARCHAR}
      
     
       and  sex = #{sex,jdbcType=VARCHAR}
     
	
		and (name like concat(concat('%',#{name,jdbcType=VARCHAR}),'%')
		or id_number like concat(concat('%',#{name,jdbcType=VARCHAR}),'%')
		or archive_no like concat(concat('%',#{name,jdbcType=VARCHAR}),'%'))
